import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  fetch('http://localhost:3000/conjugate', {
    headers: {
      'Content-Type':  'application/json; charset=UTF-8' 
    },
    mode: "no-cors",
    method: "POST",
    body: "got data?"
  }).then(data => console.log(data, 'data')).then(res => console.log(res, 'res')).then(err => console.log(err, 'err'))
  // console.log('lang_data')
  // console.log(lang_data)
  // console.log(langData)

  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
